// src/pages/MyAds.jsx
import React, { useState } from "react";
import Sidebar from "../components/Sidebar"; // Make sure Sidebar.jsx exist in components
import Footer from "../components/Footer";

const MyAds = () => {
  const [sidebarOpen, setSidebarOpen] = useState(true);

  // Dummy data for the table
  const adsData = [
    { id: 1, item: "Apartment 101", category: "üè† Apartments", price: "$1200", status: "Active" },
    { id: 2, item: "Villa Sunshine", category: "üè° Villas", price: "$5000", status: "Inactive" },
    { id: 3, item: "Office Space 12A", category: "üåÜ Office Spaces", price: "$2000", status: "Active" },
  ];

  return (
    <div className="min-h-screen bg-[#0a1124] pt-10">
      
      {/* MAIN LAYOUT */}
      <div className="flex flex-col md:flex-row gap-6 max-w-6xl mx-auto">

        {/* LEFT SIDEBAR */}
        <Sidebar sidebarOpen={sidebarOpen} setSidebarOpen={setSidebarOpen} />

        {/* RIGHT CONTENT */}
        <div className="flex-1 bg-[#111827] p-8 rounded-xl shadow-lg text-white">
          <h2 className="text-xl font-semibold mb-6">My Favorites</h2>

          <div className="overflow-x-auto">
            <table className="min-w-full text-left border border-gray-700">
              <thead className="bg-gray-800">
                <tr>
                  <th className="px-4 py-2 border-b border-gray-700">Item</th>
                  <th className="px-4 py-2 border-b border-gray-700">Category</th>
                  <th className="px-4 py-2 border-b border-gray-700">Price</th>
                  <th className="px-4 py-2 border-b border-gray-700">Ad Status</th>
                  <th className="px-4 py-2 border-b border-gray-700">Action</th>
                </tr>
              </thead>
              <tbody>
                {adsData.map((ad) => (
                  <tr key={ad.id} className="hover:bg-gray-900">
                    <td className="px-4 py-2 border-b border-gray-700">{ad.item}</td>
                    <td className="px-4 py-2 border-b border-gray-700">{ad.category}</td>
                    <td className="px-4 py-2 border-b border-gray-700">{ad.price}</td>
                    <td className="px-4 py-2 border-b border-gray-700">{ad.status}</td>
                    <td className="px-4 py-2 border-b border-gray-700">
                      <button className="px-3 py-1 text-sm bg-blue-600 rounded-lg mr-2 hover:bg-blue-700">
                        Edit
                      </button>
                      <button className="px-3 py-1 text-sm bg-red-600 rounded-lg hover:bg-red-700">
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>

      </div>

      <Footer />
    </div>
  );
};

export default MyAds;
